package uz.coder.daggerhilt.database.entityimport androidx.room.ColumnInfoimport androidx.room.Entityimport androidx.room.PrimaryKeyimport uz.coder.daggerhilt.models.Article@Entitydata class NewsEntity(    @PrimaryKey val url:String,    @ColumnInfo(name = "author") val author: String,    @ColumnInfo(name = "title") val title: String,    @ColumnInfo(name = "description") val description: String,    @ColumnInfo(name = "publishedAt") val publishedAt: String)